import React from 'react';
import './homepage.css';
import {Navbar} from '../../components';

const Homepage = () => {
  return (
    <div className='homepage'>
      <div className='homepage-top'>
        <Navbar></Navbar>
      </div>
      <div className='homepage-bottom'></div>
    </div>
  )
}

export default Homepage
